import React, { useEffect,useState } from 'react'







const Select = (props) => {

    let arr =new Array(121);
    const [options, setOptions] = useState(new Array(121));

    useEffect(() => {
       
        console.log(arr)
        arr.length=121;
        arr.forEach((i)=>{
          
            arr.push(i);
        })
    
        setOptions(arr)

    }, [])
    console.log(options)


    return (

        <select
            value={props.age}
            onChange={props.HandleInputEvent}
        // className={validation.isOnChangEventAge && age == 'Age' ? classes.red : classes.select}

        >
            <option defaultValue="Age">Age</option>
            {
                options.map((i,idx) => {

                    return <option key={i} value={idx}>{idx}</option>
                })
            }

        </select>
    )
}

export default Select
